// import React from 'react';
// import { Worker } from '@react-pdf-viewer/core';
// import PdfUploader from './PdfUploader';
// import '@react-pdf-viewer/core/lib/styles/index.css';

// const App = () => (
//   <Worker workerUrl={`https://unpkg.com/pdfjs-dist@3.11.174/build/pdf.worker.min.js`}>
//     <div>
//       <h1>Upload and View PDF</h1>
//       <PdfUploader />
//     </div>
//   </Worker>
// );

// export default App;

import React from 'react';
import './App.css';

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <h1 className="text-4xl font-bold text-center my-8">Tapestry Portfolio</h1>
            </header>

            <main className="content px-4 md:px-16 lg:px-32">
                <section className="section my-12">
                    <h2 className="text-3xl font-semibold mb-4">Introduction</h2>
                    <p className="mb-4">
                        A tapestry is a decorative textile art traditionally made by weaving threads on a loom. It consists of two main thread types: warp threads (vertical) that form the base and weft threads (horizontal) that are woven through the warp to create designs or scenes.
                    </p>
                    <p className="mb-4">
                        These designs can be simple patterns or intricate images, often telling stories or depicting historical, religious, or mythological themes. Tapestries have been used for centuries to decorate walls, provide insulation, and symbolize wealth or status.
                    </p>
                    <p className="mb-4">
                        Famous examples include the Bayeux Tapestry and medieval works like the Hunt of the Unicorn series. While traditionally handcrafted, modern tapestries can also be produced by machines. They remain a popular form of art and home decor, combining functionality with aesthetic appeal.
                    </p>
                </section>

                <section className="section my-12">
                    <h2 className="text-3xl font-semibold mb-4">Moodboard</h2>
                    <img src="/images/moodboard.jpg" alt="Moodboard" className="image mb-4 rounded-lg shadow-lg" />
                    <p className="mb-4">
                        This weaving concept captures the harmony between the moon and the sea, symbolizing cycles, renewal, and connection. Use lunar shapes to depict the phases, wavy patterns for ocean movement, and gradients of blue with touches of white or silver for moonlight on water.
                    </p>
                    <p className="mb-4">
                        The design reflects nature's rhythm and tranquility. It connects to fashion through its textured, nature-inspired design, reflecting trends in sustainability, symbolism, and artisanal craftsmanship.
                    </p>
                </section>

                <section className="section my-12">
                    <h2 className="text-3xl font-semibold mb-4">Concept</h2>
                    <img src="/images/concept.jpg" alt="Concept" className="image mb-4 rounded-lg shadow-lg" />
                    <p className="mb-4">
                        The basic "one up, one down" weave is chosen for its simplicity and versatility, which allows the focus to remain on the conceptual designâ€”moon phases and the sea. Its balanced structure creates clean lines and a rhythmic texture, complementing the themes of cycles and movement, while ensuring the colors and patterns stand out.
                    </p>
                    <p className="mb-4">
                        Knotting the ends adds structure and texture, symbolizing the closure of a cycle, while leaving some areas released and open reflects the fluidity and openness of the sea. This contrast emphasizes the balance between stability and freedom, mirroring the natural movement of water and the phases of the moon.
                    </p>
                </section>

                <section className="section my-12">
                    <h2 className="text-3xl font-semibold mb-4">Process Pictures</h2>
                    <div className="image-gallery grid grid-cols-1 md:grid-cols-3 gap-4">
                        <img src="/images/process_picture1.jpeg" alt="Process Picture 1" className="image rounded-lg shadow-lg" />
                        <img src="/images/process_picture2.jpeg" alt="Process Picture 2" className="image rounded-lg shadow-lg" />
                        <img src="/images/process_picture3.jpeg" alt="Process Picture 3" className="image rounded-lg shadow-lg" />
                    </div>
                    <p className="mt-4">
                        The process pictures section showcases the step-by-step development of the tapestry, from initial sketches to the weaving process and final details. Images can be included here for a visual representation.
                    </p>
                </section>

                <section className="section my-12">
                    <h2 className="text-3xl font-semibold mb-4">Final Result</h2>
                    <img src="/images/final_result.jpg" alt="Final Result" className="image mb-4 rounded-lg shadow-lg" />
                    <p>
                        The final result of the tapestry project combines aesthetic beauty with meaningful symbolism, serving as both an artwork and a reflection of nature's harmony.
                    </p>
                </section>
            </main>
        </div>
    );
}

export default App;
